import React from 'react';

function Header() {
  return (
    <header>
      <h1>UW Friend Finder</h1>
      <nav className="navbar">
        <ul>
          <li><a href="/user">Home</a></li>
          <li><a href="/profile">Profile</a></li>
          <li><a href="/matches">Matches</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
